import React from "react";
import { Box, Stack } from "@mui/material";

function Navigation() {
  return (
    <Box
      sx={{
        display: "flex",
        textAlign: "center",
        justifyContent: "center",
      }}
    >
      <Stack direction="row" spacing={2}>
        <Typography>hello</Typography>
      </Stack>
    </Box>
  );
}

export default Navigation;
